media_attachments.description:
ejfox: okay let's make another folder action that runs on ~/Movies - if there is ever a new .mkv added, we want to automatically convert it to mp4 with ffmpeg and trigger a transcription with the OpenAI whisper API, which we will write to a file with the same name

coachartie (bot): For this task, we will use two capabilities: the web capability to make a call to the OpenAI Whisper API for voice transcription and the github capability to create a shell script in a Github Gist which uses ffmpeg for file conversion. Then we will create a folder action that runs this script whenever a new .mkv file is added to ~/Movies.

First, we will create the shell script:

github:createGist("convertAndTranscribe.sh", "Shell script to convert .mkv to .mp4 and trigger transcription",
  'ffmpeg -i "$1" "${1%.mkv}.mp4";
   curl -X POST https://api.openai.com/v1/whisper/transcribe -H "Content-Type: application/json" -d '{
     "file": "'${1%.mkv}.mp4'"
   }' > "${1%.mkv}.txt"')


This script takes a .mkv file path as an argument, converts it to .mp4 using ffmpeg, then sends the .mp4 file to OpenAI Whisper API for transcription. The transcription result is saved as a .txt file with the same base name as the movie file.
